import React from 'react'
import styles from './HoursBar.module.css'

const HoursBar = props => {

    const hours = ['00:00', '01:00', '02:00', '03:00', '04:00', '05:00', '06:00', '07:00', '08:00',
     '09:00', '10:00', '11:00', '12:00', '13:00', '14:00', '15:00', '16:00', '17:00', '18:00', 
     '19:00', '20:00', '21:00', '22:00', '23:00']

    const dayCells = []
    for(let i = 0; i < 12; i++){
        dayCells.push(<td className={styles.Day}>{hours[i]}</td>)
    }

    const nightCells = []
    for(let i = 12; i < 24; i++){
        nightCells.push(<td className={styles.Day}>{hours[i]}</td>)
    }




    return(
        <div className={styles.HoursBar}>
            <table className={styles.Table}>
                <tr>
                    {dayCells}
                </tr>
                <tr>
                    {nightCells}
                </tr>
            </table>
        </div>
    )

}

export default HoursBar
